INSERT INTO `card` VALUES (0x75CA967FC3EB4D93B2225A1ACEBC5D95,'Armstrong','25-001C',0x8643A0190E7C11F0ABAC309C2314B3FD,0x8646F14A0E7C11F0ABAC309C2314B3FD,2,0x8649D0F50E7C11F0ABAC309C2314B3FD,0,1,0,'[Dull], discard 1 Fire card: Choose 1 Forward opponent controls. Deal it 5000 damage.\n[Fire], put Armstrong into the Break Zone: Choose 1 Forward opponent controls. Deal it 7000 damage.','2025-03-31 19:46:35','2025-03-31 19:46:35'),(0x7893E269EFC14BEBB706719FEC84C9FD,'Ace','25-005H',0x86439BD90E7C11F0ABAC309C2314B3FD,0x8646F14A0E7C11F0ABAC309C2314B3FD,6,0x8649C8EB0E7C11F0ABAC309C2314B3FD,0,0,8000,'The cost required to cast Ace is reduced by 1 for each Job Class Zero Cadet and/or Fire Character you control.\nAt the end of each of your turns, if your opponent has received 5 points of damage or less, Ace deals your opponent 1 point of damage.\nJackpot Shot [S][Fire][1]: Choose 1 Forward. Deal it 2000 damage for each Job Class Zero Cadet and/or Fire Character you control.','2025-03-31 20:28:47','2025-03-31 20:28:47'),(0xB405B8F23FF24956BAB97F10A2189C07,'Iron Eater','25-002C',0x8643A0190E7C11F0ABAC309C2314B3FD,0x8646F14A0E7C11F0ABAC309C2314B3FD,3,0x8649C8EB0E7C11F0ABAC309C2314B3FD,0,0,8000,'When Iron Eater enters the field, choose 1 Forward opponent controls. If you have 5 or more Job Warrior and/or Card Name Warrior in your Break Zone, deal it 8000 damage','2025-03-31 19:56:18','2025-03-31 19:56:18'),(0xB6A8A3DD29CD4AD4BA79406901F83129,'AVALANCHE Member','25-003C',0x8643A0190E7C11F0ABAC309C2314B3FD,0x8646F14A0E7C11F0ABAC309C2314B3FD,2,0x8649C8EB0E7C11F0ABAC309C2314B3FD,0,1,5000,'When AVALANCHE Member enters the field, you may discard 1 Category VII Character. When you do so, choose 1 Forward. Deal it 7000 damage.','2025-03-31 20:00:12','2025-03-31 20:00:12'),(0xC8B1A3905B7A42C29AF537CACE912168,'Ifrit','25-004H',0x86439BD90E7C11F0ABAC309C2314B3FD,0x8646F14A0E7C11F0ABAC309C2314B3FD,4,0x8649D1ED0E7C11F0ABAC309C2314B3FD,0,0,0,'Before paying the cost to cast Ifrit, you can remove 1 Fire Backup you control from the game to reduce the cost required to cast Ifrit by 2.\nChoose 1 Forward and up to 1 other Forward. Deal the former 9000 damage and deal the latter 4000 damage.','2025-03-31 20:20:34','2025-03-31 20:20:34');
